import ReactPlayer from 'react-player'
import gameStartingSoon from '../assets/Game_starting_soon.mp4'
import gameStartingSoon2 from '../assets/Game_starting_soon_2.mp4'
import hadAGreatDay from '../assets/Hope_everyone_had_a_great.mp4'
import { useEffect, useState } from 'react'

function Videoplayer({ gameHasStarted }) {
    const [shouldGreet, setShouldGreet] = useState(false)
    const oneOrTwo = Math.floor(Math.random() * 2) + 1;
    useEffect(() => {
        if(gameHasStarted) {
            setTimeout(() => setShouldGreet(true, 2000))
        }
    }, [gameHasStarted])
    return (
        <div>
            {!gameHasStarted && (
                oneOrTwo === 1 ? (
                    <ReactPlayer url={gameStartingSoon} playing={true} onEnded={() => { }} />
                ) : (
                    <ReactPlayer url={gameStartingSoon2} playing={true} onEnded={() => { }} />
                )
            )}
            {gameHasStarted && shouldGreet && (
                oneOrTwo === 1 ? (
                    <ReactPlayer url={hadAGreatDay} playing={true} onEnded={() => { }} />
                ) : (
                    <ReactPlayer url={hadAGreatDay} playing={true} onEnded={() => { }} />
                )
            )}
        </div>
    );
}

export default Videoplayer;
